    "description": "<html-blob><u></u><u></u><u></u><u></u><u></u><br><h4><b><strong><b>Special Information Session:&nbsp;</b></strong>How to Win Stakeholders &amp; Influence Decisions</b></h4><p>Hosted by Dr. Leslie Jensen-Inman and Jared Spool<br><strong><b>Tuesday, September 13, at 2:30pm-3:30pm ET (18.30-19.30 GMT)</b></strong><strong><b><br></b></strong><strong><b>RSVP:&nbsp;<a href=https://info.winstakeholders.com/signup><u>https://info.winstakeholders.com/signup</u></a></b></strong></p><p>We created our&nbsp;<a href=https://winstakeholders.com/><strong><b>How to Win Stakeholders &amp; Influence Decisions program</b></strong></a><strong><b>&nbsp;</b></strong>to get you past your challenges with winning difficult stakeholder buy-in. Dr. Leslie Jensen-Inman and Jared Spool have mapped out solid strategies and techniques to win over your hardest-to-convince stakeholders and focus your organization on becoming more customer and user-focused.</p><p>At this special information session, Jared and Leslie will ask you about your biggest stakeholder challenges. They'll walk through the ways you can build better connections between the values of your stakeholders and the needs of your users. They’ll discuss how our 16-week program could give you the specific coaching and mentorship you need.<a href=https://info.winstakeholders.com/clarity-call><strong><b><br></b></strong></a></p><hr><h4><b><a href=https://info.winstakeholders.com/signup id=ow1555 __is_owner=true><strong><b><u>RSVP for our&nbsp;</u></b></strong><u><strong><b>Special Information Session.</b></strong></u></a></b></h4><hr><h4><span style=color: var(--on-surface); background-color: var(--textfield-surface);>Can’t make the session, but want to find out if the&nbsp;</span><strong style=color: var(--on-surface);><b>How to Win Stakeholders &amp; Influence Decisions program</b></strong><span style=color: var(--on-surface); background-color: var(--textfield-surface);>&nbsp;is right for the challenges you're facing?&nbsp;</span><a href=https://info.winstakeholders.com/clarity-call><strong><b><u>Get on a Clarity Call with Summer or Leslie.</u></b></strong></a><br></h4><p><br></p><u></u><u></u><u></u><u></u><u></u></html-blob>",
