    "description": "<html-blob><u></u><p>In every UX leader's career, there comes the point when influence becomes essential to success. There will be a stakeholder who needs convincing. Developers who need to change what they’re doing. Executives you’ll need to support a critical initiative.</p><p>Influence isn’t something you’re born with. It’s a set of skills you can learn. With these newly acquired skills, you can communicate your position so others get as excited as you about the changes you’d like to see.</p><p>Mastering these essential communication skills will open doors to more advanced levels of leadership. Objections that currently hold you back will become voices of support. A little expertise and practice in these new skills will take you a long way in your desire to make your organization more UX mature.</p><p>Join Jared Spool to explore the critical communication skills used by successful UX leaders. You’ll discover the mindset changes and practical techniques for communicating why great UX will strengthen your organization.</p><p>In this session, we’ll explore how to…</p><p>…&nbsp;Uncover the priorities of key stakeholders so that you can position your ideas as a way they’ll attain their critical objectives.</p><p>… Overcome mental roadblocks you’ve put in place that accidentally prevent you from genuinely collaborating with team members.</p><p>… Identify the common ground that turns the most contentious discussions into forward-moving initiatives.</p><p>______________________________________<br></p><p><strong>Join Zoom Meeting:</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09></a><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501</strong></p><p><strong>Passcode: awesome!</strong></p><p><strong>Waiting Room Enabled</strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p><u></u></html-blob>",
