    "created": "2022-07-19T13:47:54Z",
    "description": "<html-blob><p dir=ltr><i>Every UX leader we know wants it, you want it too.</i>&nbsp;</p><p dir=ltr>You want to be brought into the decision-making process sooner. You want to have a say in the critical decisions affecting your users’ experiences.</p><p dir=ltr>You want your UX experience to factor in what a new feature or product should do (and what it won’t do). You want a say in the design priorities and in how long the team will have before they need to deliver.</p><p dir=ltr>You want to influence the time allowed for research, what can be changed, and how many designers and researchers will be on the project full-time. You want UX input into the most critical decisions that affect the UX.</p><p dir=ltr>Join Jared Spool to uncover how UX leaders have successfully gained strategic influence in their organizations. You’ll discover their enormous progress when they change their approach to participating in these critical discussions.</p><p dir=ltr>In this session, we’ll explore…</p><p dir=ltr>… Where decisions are made and how you’ll become part of those discussions to ensure stakeholders consider a UX perspective.</p><p dir=ltr>… How successful UX leaders have won over the decision makers by becoming their official go-to source for reducing significant risk.</p><p dir=ltr>… Which changes to your UX process you’ll need to become more influential in your organization.</p><p>______________________________________</p><p><strong>Join Zoom Meeting:</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09></a><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501</strong></p><p><strong>Passcode: awesome!</strong></p><p><strong>Waiting Room Enabled</strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
