    "description": "<html-blob><u></u><p><b>Special Information Session: &nbsp;How to Win Stakeholders &amp; Influence Decisions</b></p><p>Host by Dr. Leslie Jensen-Inman and Jared Spool<br>Wednesday, July 27, at 3pm-4pm ET (19.00-20.00 GMT)<br>RSVP:<strong><b>&nbsp;<a href=https://teams.winstakeholders.com/information id=ow577 __is_owner=true>https://teams.winstakeholders.com/information</a></b></strong></p><p>You’re invited to join us for a special information session on our new&nbsp;<a href=https://teams.winstakeholders.com/information><strong><b>How to Win Stakeholders &amp; Influence Decisions program</b></strong></a>. This session is Wednesday, July 27, at 3pm ET (19.00 GMT).</p><p>We created the new&nbsp;<a href=https://winstakeholders.com/><strong><b>How to Win Stakeholders &amp; Influence Decisions program</b></strong></a>&nbsp;to get you past your challenges with winning difficult stakeholder buy-in. When you join the program, Dr. Leslie Jensen-Inman and Jared Spool will give you solid strategies and techniques to win over these hard-to-convince stakeholders and focus your organization on becoming more customer and user-focused.</p><p>At this special information session, Leslie and Jared will ask you about your biggest stakeholder challenges. You'll work together to discuss various approaches to overcoming these challenges. And you’ll discuss how our new&nbsp;<a href=https://winstakeholders.com/><strong><b>How to Win Stakeholders &amp; Influence Decisions program</b></strong></a>&nbsp;could give you the coaching and mentorship you crave.</p><p>(Can’t make the session, but want to talk with Jared or Leslie about your challenges? Send a&nbsp;<a href=https://leaders.centercentre.com/chats/new?user_id=3704006><strong><b>DM to me, Summer Kohlhorst</b></strong></a>&nbsp;to get on my list to learn about future information sessions.)<br><br></p><p><b>RSVP to receive the Zoom details:&nbsp;<a href=https://teams.winstakeholders.com/information><u>https://teams.winstakeholders.com/information</u></a></b></p><u></u></html-blob>",
