    "created": "2022-06-03T19:15:26Z",
    "description": "<html-blob><p>Work in an environment where UX is the priority.<br><br>In many organizations, delivering a great user experience does not come naturally. UX leaders must remind, encourage, and pester their stakeholders and peers to consider users' needs in critical decisions and discussions. It always feels like a struggle to deliver the minimum of good experiences. In these organizations, great UX is not part of their culture.<br><br>It’s possible, however, to build a culture where this isn’t a daily struggle. You can make a culture where stakeholders and decision-makers are hungry for detailed user research. Products only ship when it’s clear they’ll improve users’ lives. You can build a culture of great UX in your own organization.<br><br>In this session, Jared Spool will explore how UX leaders can build a culture of great UX in their organization. You’ll discover the baby steps necessary to start your organization down a path where the needs of the user factor into every decision.<br></p><p>___________________________</p><p><strong>Join Zoom Meeting:</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09></a><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501</strong></p><p><strong>Passcode: awesome!</strong></p><p><strong>Waiting Room Enabled</strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
