    "created": "2022-05-05T14:35:33Z",
    "description": "<html-blob><p dir=ltr>Note: This session is on Tuesday due to the U.S. Memorial Day holiday.</p><p dir=ltr>Transform your organization with insights that make a difference.</p><p dir=ltr>Every big decision affects your users’ experience. What products or features should you build next? How will you tell when it’s ready to deliver? Who will be on the team that builds and delivers it? How long will the team have to work on it?</p><p dir=ltr>Are the people who make these big decisions — the executives and key stakeholders — are they basing their decisions on user research? For most organizations, the answer is no.</p><p dir=ltr>Yet, these are the very decisions that most need user research insights. So how do we infuse these decisions with the research that will produce innovative, game-changing results?</p><p dir=ltr>In this session, Jared Spool will explore how UX leaders have transformed their research practices to target the big decisions affecting their users. In addition, you’ll discover how to position research as a strategic tool for raising your team’s influence.</p><p dir=ltr>You’ll want to bring your Product leadership to this highly-informative session. They’ll see how proactive user research will make their jobs easier and their decisions substantially less risky.</p><p dir=ltr>______________________</p><p><strong>Join Zoom Meeting:</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09></a><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501</strong></p><p><strong>Passcode: awesome!</strong></p><p><strong>Waiting Room Enabled</strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
