    "created": "2022-04-28T17:26:41Z",
    "description": "<p><em>Better ways to see how a UX candidate is great for your team.</em></p><p>In today’s UX hiring environment, portfolios have become an unnecessary obstacle. Many top-qualified candidates for your position won’t have one ready to show you. </p><p>Their work may be tied up behind non-disclosure agreements or hasn’t even shipped yet. The best candidates might be so busy with their work and life that they haven’t had any time to assemble their work. Even if they had time, their UX work may not be visual, thus making a portfolio an ineffective hiring tool. To make things harder, other (smarter) organizations are rapidly recruiting those top-qualified candidates without ever asking to see their portfolios. </p><p>You need better alternatives to portfolio evaluation. You need to identify those candidates that have the right experience. You need someone who can do the UX work your team needs.</p><p>In this discussion, Jared Spool will explore how to quickly find the candidates who will be great additions to your team. You’ll discover how to structure your interview process to uncover what really matters without pushing away the best qualified, portfolio-less candidates.</p><p>______________________________________</p><p><strong><b>Join Zoom Meeting:</b></strong></p><p><strong><b><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09></a><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></b></strong></p><p><strong><b>Meeting ID: 882 9272 8501</b></strong></p><p><strong><b>Passcode: awesome!</b></strong></p><p><strong><b>Waiting Room Enabled</b></strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p><br /></p><p>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
