    "created": "2022-04-07T19:02:41Z",
    "description": "<p dir=ltr><i>Gain the benefits of an operations team by avoiding the trap of waiting too long. </i></p><p dir=ltr>There is a point where operationalizing UX design, research, and content becomes essential for making our teams more effective. When you hit that point, building a DesignOps effort becomes the best path forward.</p><p dir=ltr>Identifying the right moment becomes key to the effort’s success. If we start it too late, we slow down UX work and spread our efforts too thin across the organization. If we start too early, we may incur large expenses without seeing the important benefits. And, once we start, we’ll need to know which activities are most critical to operationalizing first.</p><p dir=ltr>In this discussion, Jared Spool will explore how to prioritize your new operations team’s effort and when is the best time to start.  You’ll discover how to best prepare for this eventual, critical component of leading a UX effort in your organization.</p>____________________________<br><br><p><strong>Join Zoom Meeting:</strong></p><p><strong><a href=https://www.google.com/url?q=https://us02web.zoom.us/j/88292728501?pwd%3DY0tBR25GbFF4MUxhWnd5MFI5S3hNUT09&amp;sa=D&amp;source=calendar&amp;ust=1649788390852379&amp;usg=AOvVaw2lX-IBkjuJx1ReY1W3L4Ul target=_blank></a><a href=https://www.google.com/url?q=https://us02web.zoom.us/j/88292728501?pwd%3DY0tBR25GbFF4MUxhWnd5MFI5S3hNUT09&amp;sa=D&amp;source=calendar&amp;ust=1649788390852379&amp;usg=AOvVaw2lX-IBkjuJx1ReY1W3L4Ul target=_blank>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501</strong></p><p><strong>Passcode: awesome!</strong></p><p><strong>Waiting Room Enabled</strong></p><p>One tap mobile</p><p>+19294362866,,88292728501# US (New York)</p><p>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location</p><p>+1 929 436 2866 US (New York)</p><p>+1 301 715 8592 US (Germantown)</p><p>+1 312 626 6799 US (Chicago)</p><p>+1 669 900 6833 US (San Jose)</p><p>+1 253 215 8782 US (Tacoma)</p><p>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number: <a href=https://www.google.com/url?q=https://us02web.zoom.us/u/knP9JWtT2&amp;sa=D&amp;source=calendar&amp;ust=1649788390852379&amp;usg=AOvVaw1euGJk1zemTudN0O3H3y1s target=_blank></a><a href=https://www.google.com/url?q=https://us02web.zoom.us/u/knP9JWtT2&amp;sa=D&amp;source=calendar&amp;ust=1649788390852379&amp;usg=AOvVaw1euGJk1zemTudN0O3H3y1s target=_blank>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
