    "created": "2022-03-17T20:17:56Z",
    "description": "<html-blob><u></u><u></u><p dir=ltr><i>Drive your organization to truly put customers and users at the center.</i></p><p dir=ltr>Building up our Agile UX muscles are essential for delivering well-designed products and services. It’s a great start, but it’s not the only work we’ll need to do. To truly have impact, we must create and execute a strong UX strategy.&nbsp;</p><p dir=ltr>A great strategy will drive the organization to new levels of customer and user focus. It will have a lasting effect, by centering the organization on continually delivering greatness, raising the standards so that mediocre outputs are no longer tolerated.</p><p dir=ltr>As a UX leader, you can drive the strategic transformation in your organization that will change everything.</p><p dir=ltr>By attending Monday’s session, you’ll see how:</p><ul><li dir=ltr><p dir=ltr>You will be influencing executive-level decisions that affect the users’ experiences, because you’re talking (and walking) the language of organizational strategy.</p></li></ul><ul><li dir=ltr><p dir=ltr>Your executive leadership will promote how your products improve lives of customers and users, because they understand how great UX means great business.</p></li></ul><ul><li dir=ltr><p dir=ltr>Your UX leaders will have the respect of key stakeholders, when they can clearly see the long-term vision of where the products will make an impact on the marketplace.</p></li></ul><p><b>____________________________________</b></p><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></u></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2><u>https://us02web.zoom.us/u/knP9JWtT2</u></a></p><u></u><u></u></html-blob>",
