    "uid": "7suop2uki2t6hgin7h12d3tep0@google.com",
    "attendee": "",
    "created": "2022-03-17T20:17:38Z",
    "description": "<html-blob><p dir=ltr><i>We must change our approach to Agile and to UX to have the impact we want.&nbsp;</i></p><p dir=ltr>Much of what holds us back is outdated thinking about what both UX and Agile are. We’re stuck in 2001 when Agile was first conceived and today’s UX practices were in their infancy. We’ve learned so much in the last two decades. We know how to do better.</p><p dir=ltr>Agile and UX&nbsp;<b>can&nbsp;</b>work together. To do that, we need to reframe some misconceptions about how we put them together. We need to replace old, dysfunctional habits with state-of-the-art techniques and processes.&nbsp;</p><p dir=ltr>By attending Monday’s session, you’ll see how:</p><ul><li dir=ltr><p dir=ltr>You will improve your Agile teams’ delivery capabilities by building a shared understanding of what your users need.</p></li></ul><ul><li dir=ltr><p dir=ltr>Your UX work will have more influence on the products your teams deliver when you shift your UX efforts from being&nbsp;<i>reactive</i>&nbsp;to&nbsp;<i>proactive.</i></p></li></ul><ul><li dir=ltr><p dir=ltr>You will stop feeling trapped and frustrated by the timeframes of short sprints, because your UX work continually contributes value from concept through delivery, and beyond.</p></li></ul><p><b>____________________________________</b></p><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></u></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2><u>https://us02web.zoom.us/u/knP9JWtT2</u></a></p></html-blob>",
