    "created": "2022-02-07T20:33:51Z",
    "description": "<html-blob><br><i>Note: This is on a Tuesday, because Jared will be traveling on Monday.</i><br><i><br></i><br><p dir=ltr><i>Overcome the anxiety from trying to work faster, instead of smarter.</i></p><p dir=ltr>Somewhere along the way, UX professionals got the wrong idea about Agile. They started thinking that Agile development methods required them to shrink down their UX process to fit everything into a 2 or 3-week sprint. So much anxiety comes from trying to ‘smallify’ our work.</p><p dir=ltr>In Agile UX, we do much better when we reverse this thinking. UX doesn’t happen inside of an Agile sprint. Sprints happen inside of our UX efforts.</p><p dir=ltr>In this lively discussion, Jared Spool will show you how to execute a longer UX effort that embodies multiple sprints that feed into a UX release. You’ll explore how to deliver substantially more value to the teams who need UX insights to do a great job.</p>__________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
