    "created": "2022-02-07T20:32:58Z",
    "description": "<html-blob><p dir=ltr><i>Lead your Agile efforts when you become instrumental in work prioritization.</i></p><p dir=ltr>In Agile, the product backlog is where the magic starts. And it’s where UX leaders can have the most impact on what an Agile team delivers.</p><p dir=ltr>UX leaders can — and should — play an influential role in determining what their Agile team works on next. They can do this by providing key insight into user needs, making the backlog show how the team’s work is human-centered.</p><p dir=ltr>In this discussion, Jared Spool will demonstrate powerful techniques for introducing a UX-centric prioritization scheme for backlog work. You’ll explore how you can get the UX perspective on what gets worked on next while influencing what goes into the backlog in the first place.</p>__________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
