    "created": "2022-02-07T20:30:38Z",
    "description": "<html-blob><p dir=ltr><i>Increase the flexibility and agility of your UX team.</i></p><p dir=ltr>At first glance, establishing a formal UX process seems like a good thing. However, it often can hurt your UX team’s efforts more than it helps. Establishing a process sends the message that all UX problems are solved the same way, with the same inputs producing the same outputs. Unfortunately, your process may lead to a frustrated team and mediocre UX work.</p><p dir=ltr>Many UX leaders find it’s better to adopt a playbook approach. Your team fits their approach to solving hard research and design problems using a mix-and-match combination of techniques, methods, and advanced skills. The results are higher quality and more innovative designs, which improve the value of your team’s contributions.</p><p dir=ltr>In this discussion, Jared Spool will explore how a great UX playbook is a game-changer for UX leaders, pushing their teams to see vastly improved results from their work. You’ll discover how this simple mindset change can unleash a more flexible way of tailoring UX efforts to the true problems your product teams face.</p>__________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
