    "created": "2022-02-07T20:32:27Z",
    "description": "<html-blob><p dir=ltr><i>Raise the UX maturity of every Agile team member.</i></p><p dir=ltr>Imagine working on a team where everyone — the developers, the product managers, every team member — had the skills and knowledge to produce UX work. Not the world’s best UX work, but good enough for your customers and users. You could save time by not needing to redo or even check their work. Instead, you could focus on the hard-to-solve UX problems you otherwise don’t get to.&nbsp;</p><p dir=ltr>Your job as a UX professional is harder when you’re the only team member who understands how to conduct insightful UX research and deliver good UX designs. This is a solvable challenge. You need to shift from delivering research and design to facilitating the delivery of good research and design.</p><p dir=ltr>In this discussion, Jared Spool will share powerful techniques that bring better UX skills to your Agile teams. You’ll explore effective approaches to raising the UX literacy and fluency of the people who unwittingly make critical design decisions every day.</p><br>__________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p></html-blob>",
