    "created": "2022-02-07T18:42:51Z",
    "description": "<html-blob><u></u><i>Get your team members recognized and rewarded for their amazing contributions.</i><br><br>When UX isn’t seen as essential to the business, the team loses its visibility. The hard work of team members isn’t recognized. They may not get access to promotions or contribution benefits. This constrains the team’s growth, which also makes it more difficult to add value. It’s a vicious cycle.<br><br>How do you break the cycle and make sure your team is visible? In this discussion, Jared Spool will explore how great UX management can connect the work the team is doing to important business milestones and objectives. He’ll show the efforts UX managers can take to make sure the team's best work is recognized and rewarded.</html-blob><br><html-blob><br><i>(Note: This session is on a Tuesday because of the U.S. holiday)</i><br>__________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p><u></u><u></u></html-blob>",
