    "created": "2022-02-07T18:41:39Z",
    "description": "<html-blob><p><i>Move your organization from ‘product management’ to ‘experience management.’</i></p><p>Real innovation comes, not from delivering more features, but from making your product work better in the lives of those who will use it. Users and customers appreciate it most when you make their lives better. They appreciate how you’re making things in their lives easier, simpler, and more enjoyable.</p><p>In this discussion, Jared Spool will explore how to shift your organization from being product-focused to becoming experience-focused. He’ll walk through techniques and practices that remove the unsightly seams in your users’ experience by adopting a practice of “experience management.”</p><b>__________________________________<br></b><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p><u></u></html-blob>",
