    "description": "<html-blob><u></u><p><i>Track your progress to achieving better user experiences.</i><br></p><p>You’ve chosen great UX goals that will inspire your team to deliver great user experiences. Now, it’s time to measure how well your team is doing. You’ll need compelling metrics that show what progress they’ve made and when they’ve achieved success.</p><p>In this live discussion, Jared Spool will explore how you start with your UX outcomes to identify key metrics, which you can plug into your OKRs and KPIs. Jared will show how you’ll keep the focus on your users with UX metrics that lead to improvements in their experiences.</p><p><em>_____________________________________</em></p><p><strong>Join Zoom Meeting:</strong></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501</p><p>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p><u></u></html-blob>",
