    "created": "2022-01-20T21:59:28Z",
    "description": "<html-blob><u></u><p><span>Get that seat at the table by upping your UX leadership game.</span></p><p><span>Crafting your Audacious UX Goals is just the beginning. You’ll need a complete UX strategy to move your organization forward. Your UX strategy is your high-level plan for delivering better-designed products and services.&nbsp;</span></p><p><span>Once you’ve established your goals, you’ll need the right UX metrics to track your progress. You’ll need a strong UX team, set up for continuous learning, to provide leadership throughout the organization. You’ll need a rich UX research capability to provide the foundation for new innovation. These are the essential elements of a vibrant&nbsp; UX strategy.</span></p><p><span>In this session, we’ll explore what it means to become more strategic. We’ll work through all the key elements you’ll need for your UX strategy. We’ll show how your Audacious UX Goals are your first step to success.</span></p><p><i>_____________________________________________________</i></p><p><b><a href=https://goals.centercentre.com/>https://goals.centercentre.com/</a></b><br></p><u></u></html-blob>",
