    "created": "2022-01-20T21:47:05Z",
    "description": "<html-blob><p><i>Establish organization-wide targets for delivering great UX.</i></p><p>When we don’t have a well-defined goal, it’s almost impossible to make progress. Our teams can’t break free of the treadmill-like production of ever-increasing “improvements” to products and services that grow more complicated every day. We’re running hard without moving forward.</p><p>We can break the cycle by setting a strong target—not just moving up business numbers like retention and engagement, but by truly improving our users' experiences. We can drive innovation and push our way to become industry leaders when we deliver the best user experiences. This is where <b>Audacious UX Goals</b>&nbsp;come into play.</p><p>You’ll learn how to create Audacious UX Goals so that…</p><p><b></b></p><ul><li><p>You excite the entire organization with how much better a human-centered approach can make your products and services.</p></li><li><p>You get everyone on the same page about what great UX looks like.</p></li><li><p>You can create a product roadmap that delivers innovative value in every release.</p></li></ul><br>_____________________________________________________<p><b>https://goals.centercentre.com/</b></p></html-blob>",
