    "description": "<html-blob><i>(Note: This is Tuesday due to the U.S. Holiday.)</i><i><br></i><br><i>Inspire your Agile teams to up their UX game with solid UX objectives.</i><br><i><br></i><br>User stories, by themselves, don’t lead an agile team to deliver a quality user experience. Instead, the team needs solid UX goals to establish each sprint’s “definition of done” and give the team a clear picture of success.<br><br>In this session, Jared Spool will outline a strategy that highly-effective UX leaders use to focus their agile teams on delivering innovative, high-quality products and services. He’ll detail the rituals, tips, and techniques for aligning teams with practical and powerful UX goals.<br><i>&nbsp;</i><br><i>_________________________________________________</i><br><i>_________________________________________________</i><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></html-blob>",
