    "created": "2021-11-19T15:36:04Z",
    "description": "<p><i><span>Brand is the inescapable collision of Marketing and UX.</span></i></p><p><span>Your organization’s brand represents how your customers think of you. It’s what gets customers to think of your products and services. It’s how customers choose you over your competitors.</span></p><p><span>Organizations invest in building stronger brands. What’s the best investment? It’s not in a new logo, product name, or tag line. It’s in the experiences your products and services deliver. That’s what will stand out and strengthen your brand the most.</span></p><p><span>In this session, Jared Spool will explore how UX leaders strengthen brands when they focus on delivering compelling products and services. We’ll discuss how UX teams can partner with marketing brand efforts and how a memorable, delightful experience is the best way to strengthen brands.</span></p><i>_________________________________________________</i><br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a>",
