    "created": "2021-11-19T15:33:50Z",
    "description": "<i>When saying ‘no’ is a UX leader’s secret to making significant progress.</i><br><br>It’s a natural inclination for UX teams to say ‘yes’ to every project opportunity. After all, they want your help, and that’s not always been the case. The downside of saying ‘yes’ too much is that we start spreading ourselves too thin. That makes it hard to do quality work for anyone.<br>Successful UX leaders employ a well-defined UX strategy to clearly identify which projects their teams say ‘yes’ to and which ones they politely decline. They don’t abandon those other teams. Instead, they give them support to become self-reliant. This, in turn, boosts the organization’s overall UX maturity — a win-win for all.<i>&nbsp;</i><br><i>_________________________________________________</i><br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a>",
