    "created": "2021-11-19T15:30:03Z",
    "description": "<i>Difficult hiring is made worse when your process unwittingly pushes away your most ideal candidates.</i><i><br></i><br>Hiring new UX team members has never been more challenging. The most-qualified candidates get to pick their next team (and it may not be yours). Meanwhile, hiring managers are flooded with applicants who don’t have the necessary skills, experience, and knowledge to succeed in the new position.<br><br>This problem is made worse when the team, often unknowingly, pushes ideal candidates away. Candidates believe the team doesn’t have their act together. Or they conclude the job is not right for them, when it clearly is a great match. These faux pas are easy to make, and it’s likely the team never finds out. Hiring is hard.<br><br>In this session, Jared Spool explores unintentional gaffes your team could be making and what you can do about them. You’ll learn how successful UX leaders speed their hiring process, and hone right in on ideal candidates. If you’re expanding your team in the next few months, don’t miss this discussion._________________________________________________<br><p><b>Join Zoom Meeting:</b></p><p><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a>",
