    "created": "2021-11-19T14:32:19Z",
    "description": "<i>Gain powerful leadership skills that work when work gets political.</i><br><br>When your organizations are political, our normally challenging work becomes even more difficult. It would be great if you could just wish the politics away and ask everyone to get on the same page. Unfortunately, that’s not a wish that’ll ever come true.<br><br>Successful UX leaders learn to go beyond “navigating” politics. They learn to use it to their advantage. Understanding how power works inside the organization, how people are rewarded (or penalized), and how key stakeholders and executives set the agenda is the key to strengthening their UX strategy.<br><br>In this session, Jared Spool will break down why organizations get political and what we can do when it happens. You’ll learn the secrets of exceptional UX leaders, who turn to servant leadership to get high-level support and sponsorship to produce results.<br>________________________________________________<br><b>Join Zoom Meeting:</b><b><br></b><br><b><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></b><br><br><b>Meeting ID: 882 9272 8501</b><br><b>Passcode: awesome!</b><br><b>Waiting Room Enabled</b><br><br>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)<br>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)<br><br>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a>",
