    "created": "2021-11-18T21:31:21Z",
    "description": "<i>Avoiding generic one-size-fits-all solutions.</i><br><br>When thinking about users, it’s easy to gravitate to roles. The users of an education service might be students, teachers, and parents. A healthcare product might serve patients, doctors, and nurses. It’s easy to think this way, but it’s also remarkably unhelpful.<br><br>The problem with these generic role-based personas is they imply that everyone in a given role approaches the product the same way. That all teachers work the same. That all doctors need the same capabilities. It pushes us into a one-solution-fits-all approach that only gets us into trouble.<br><br>In this session, we’ll discuss how personas work best when we start by understanding what our users do with our products and services. Jared Spool will lead a discussion into the subtlety and nuance we need to craft truly effective designs that meet the needs of users and customers.<br>________________________________________________<br><b>Join Zoom Meeting:</b><br><b><br></b><br><b><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></b><br><b><br></b><br><b>Meeting ID: 882 9272 8501</b><br><b>Passcode: awesome!</b><br><b>Waiting Room Enabled</b><br><br>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)<br><br>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)<br><br>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a>",
