    "created": "2021-11-15T02:59:29Z",
    "description": "<h4>  <b>What Your UX Metrics Strategy Looks Like</b>: Discussion and Live Q&amp;A</h4><p>You need a solid UX Metrics strategy. You need your UX metrics to go beyond how we report ongoing work status. </p><p>Your UX Metrics Strategy must play a crucial role in how your organization thinks about achieving its overall goals. When you deliver a fantastic user experience, how does that help the organization? The UX metrics we choose must answer that question.</p><p>In this session, we’ll explore what it means to become more strategic. We’ll work through how you can position your UX metrics to become influential throughout your organization. And we’ll discuss what’s necessary to create a UX Metrics Strategy tailored to your own organization.</p><p><b>Join Zoom Meeting:</b><b> </b><br><b><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09 target=_blank><b>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</b></a></b></p><p><b>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</b></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
