    "description": "<p><i>Show off your team’s best work through the right mix of behavioral and attitudinal metrics.</i></p><p>It’s essential you measure and report the improvements your UX team makes to your users’ experiences. However, what exactly should you measure?&nbsp;</p><p>Should you focus on what your users are doing with your team’s revised designs? Or should you concentrate on how your users feel about those design changes?</p><p>In this live discussion, Jared will explore how to find the right mix of behavioral and attitudinal metrics to represent your teams’ best design work. You’ll hear the most effective ways to measure both, while discovering which traps to avoid.</p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
