    "description": "<h3>Persuasive UX Metrics intensive led by Jared Spool</h3><p><b>Nov 8-15 (New! UX Leader VIP Sessions Nov 8-18)</b></p><p><b>Persuasive UX Metrics amplify the story of your UX work.</b></p><p><b>People can only value what they see.</b></p><p>Join our Intensive and together, we’ll explore how you’ll identify, research, and execute a new approach to measuring the user experience. You will:</p><ul><li>Convey how your team’s work improves people’s lives using UX Outcomes.</li><li>Provide new ways to measure your human-centered accomplishments with <i>UX Success metrics.</i></li><li>Demonstrate continuous improvements by embracing <i>UX Progress metrics.</i></li><li>Reveal the hidden costs of poor UX with <i>Problem-Value metrics.</i></li><li>Drive your organization to become more UX mature using <i>customer-focused targets and objectives.</i></li></ul><p><b>Are you ready to learn? Or are you ready to lead?</b> From November 8 through November 18, we’ve got an Intensive package that’s perfect for where you’re at.</p><ul><li>UX Learner Package — Free access to the Intensive materials</li><li>UX Leader VIP Packages — Comprehensive access for great value</li></ul><p><a href=https://puxm.uie.com/><b>Join our Persuasive UX Metrics intensive today.</b></a></p>",
