    "description": "<h2>Live Job Ad Critique and Rewrite with Jared Spool</h2><p><strong>Lead by Jared Spool</strong><br><strong>October 14, 2021, 2pm ET (18.00 GMT)</strong></p><p>Hiring new UX professionals is hard work. Part of what makes it hard is attracting the right applicants. When we get highly-qualified applicants, the hiring job goes much easier.</p><p>Yet, too many teams don’t realize how much their job advertisements are preventing those highly-qualified applicants from actually applying. In many cases, the way the ad is written pushes applicants away, leaving teams only to have less-qualified applicants flooding their candidate pool. Less-qualified applicants make hiring take longer and risk ending up with someone who isn’t right for the job.</p><p>That’s why Jared is hosting our first <a href=https://awesomeness.samcart.com/products/live-job-ad-critique-and-rewrite/><strong><em>Live Critique and Rewrite session</em></strong></a>. During this special live session, he'll go over exactly what you need to include in (and maybe even more importantly what to leave out of) your job ad so you can save time and attract highly-qualified applicants.</p><p>Join us on October 14 as Jared walks you through the common traps that hiring teams fall into, which drive off the exact candidates they’re trying to attract. He’ll work with the hiring manager who wrote the ads, to craft a more persuasive, compelling advertisement that will attract exactly the right candidate the team is seeking.</p><p>If you're not ready for a live critique, you can sign up to just observe the session. You'll learn a whole bunch just by watching ads get critiqued and rewritten.</p><p>____________________________________ <br></p><h3>  <strong>Register to Attend the Session</strong><br>  </h3><p><strong>ONE SPOT LEFT</strong><br><a href=https://awesomeness.samcart.com/products/live-job-ad-critique-and-rewrite/><strong>Register to have your current job advertisement improved.</strong></a> We’ll only have time to critique 3 ads. The first three hiring managers to sign up for $499 will get a live critique and a free 30-day post on our<strong>&nbsp;</strong><a href=https://uxcareers.uie.com><strong>UX Centered Careers</strong></a><strong>&nbsp;</strong>job board (a $300 value).&nbsp;</p><p><strong>LIMITED SPOTS AVAILABLE</strong><strong>&nbsp;</strong><br><a href=https://awesomeness.samcart.com/products/live-job-ad-critique-and-rewrite/><strong>Register to observe the critiques and learn how to create a great job ad yourself.&nbsp;</strong></a>It’s only $99 to join. The spots to observe are limited too, so don’t miss out. These will sell out quickly.</p><p>We hope you’ll join us on <strong>October 14, 2021, 2pm ET (18.00 GMT)&nbsp;</strong>for this new session focused on helping you hire the UX team members your organization needs.</p><p><strong>Once you’ve registered, we will send you the session meeting location and information.</strong></p>",
