    "created": "2021-09-30T21:05:59Z",
    "description": "<p><em>Hiring great team members is hard. Why make it harder?</em></p><p>There’s a high chance your most recent job advertisement isn’t doing as well as you wanted it to do. Instead of attracting highly-qualified applicants, it’s pushing them away. Instead of clearly communicating the skills you require for the position, it’s attracting under-qualified applicants by the dozens. Or nobody at all.</p><p>Many hiring managers make the mistake of copying someone else’s job ad. This makes it impossible for the best-qualified candidates to find any reason to apply. And, many hiring managers don’t even realize they’ve done this.</p><p>If you’re not getting the candidates you’d like to see into your hiring process, you may need to rework your job ad. In this session, Jared will share what makes compelling job ads work. He’ll explore how the most effective ads make it irresistible for highly-qualified applicants to apply.</p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
