    "description": "<p>(Note: This session will be on a Tuesday due to the U.S. Labor Day holiday.)</p><p><em>Conduct better research by building an effective participant recruitment process.</em></p><p>Effective user research requires us to have qualified participants in our research sessions. This makes participant recruitment a critical part of any user research effort.<br><br>Yet, too many teams wait until the weeks (or even days) before their scheduled sessions to think about how they’ll find the participants they’ll need. They try to recruit at the last moment, then get frustrated by how difficult it is. This makes the research stressful and can hurt the quality of the research.</p><p>In this session, Jared will discuss how a well-planned and executed recruitment process can dramatically improve the value of the team’s overall UX work. Jared will directly connect how an investment in recruitment delivers the deep understanding about users that your entire team needs to design great products and services.</p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
