    "created": "2021-08-05T16:25:48Z",
    "description": "<p><span><i>User research is an ideal tool for improving the accuracy of our gut feelings.</i></span></p><p>Six stakeholder words that make UX leaders cringe: “I know what our users need.” There’s been no research, yet the stakeholder feels in their gut that they are right.</p><p><span>Here’s the thing: </span><span>They might be.</span><span> (Even a blind squirrel finds an acorn every so often.) Gut feeling is a thing and we need to learn to work with it.</span></p><p>In this discussion, Jared will explore how we work with confident stakeholders who don’t think we need to do research (or choose to ignore the research we’ve done). He’ll share how focusing on assessing and reporting confidence can improve the results when we need to rely on our gut for important decisions.</p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
