    "description": "<p><span><i>Measure the improvements in our users’ experience.</i></span></p><p><span>At the core of UX is the experiences of our users. If we do a great job of delivering great UX, we improve those experiences, and improve the lives of those users. But how do we know? How do we show we’ve made those improvements?</span></p><p><span>User experience is inherently hard to measure and track. However, it’s not impossible. It just takes the right approach.</span><span><br></span><br></p><p>In this discussion, Jared will walk you through the process of taking UX outcomes — the improvements in people’s lives — and making them measurable. He’ll show how to track those measures, so you can report how much progress your designs are making.&nbsp;<span><br></span></p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
