    "created": "2021-08-05T16:24:45Z",
    "description": "<p><span><i>A well-crafted roadmap journey delivers value to our users in every release.</i></span></p><p><span>When the product roadmap is a long wish list of features, it drives products and services to become overly complex and reduces their value. Yet, this approach to roadmaps is extremely common in many organizations.</span></p><p><span>Instead, if the team starts with a well-researched vision of what would solve the customers’ and users’ biggest challenges, they can build a roadmap on the steps necessary to achieve that vision. The resulting journey builds value every step of the way, avoiding complexity and allowing the team to focus on delivering great outcomes.</span></p><p><span>Join Jared in this lively discussion on how to shift your team from a cluttered wish list to a thoughtful, considered journey. He’ll discuss how great UX research changes the value of the roadmap, making it clear how every new release will achieve key outcomes and build value for customers.</span></p><hr><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
