    "created": "2021-06-18T17:42:31Z",
    "description": "<h2>The (Not-So) Secret UX Strategy Session</h2><p>As a UX Leader, does your work exhaust or energize you?</p><p>Not sure who needs to hear this… Life is both too short <em>and</em> too long to do work that exhausts you.&nbsp;</p><p>During this session, Jared Spool will share the one thing that makes the difference in whether your UX work is exhausting or exciting. The one (not-so) secret thing is a proactive UX strategy.</p><p>If you’re finding your UX work to be exhausting, it’s likely your organization has a completely reactive UX strategy. A reactive UX strategy means your UX team just _reacts_ and scrambles to get work done as quickly as possible, compromising (big time) on quality and completeness. Then (without taking a break) picking up the next project, reacting to the work that needs to get done, and doing it again. It’s exhausting just thinking about it.</p><p>A proactive UX strategy puts planning and forethought into your UX work. Using a UX strategy, UX leaders get ahead of their work, influencing the most important design decisions in their organization before any real constraints are locked into place. _It’s what folks mean when they say UX should get “a seat at the table.”_</p><p>Stop being exhausted and discover how to become an energized UX leader. Craft and implement your organizations’ proactive UX strategy.&nbsp;</p><ul><li><p>Put together a multi-year vision of what it will be like to use your designs.</p></li><li><p>Conduct research that reveals how to deliver innovative products.</p></li><li><p>Deliver better-designed products and services that truly meet your users’ needs.</p></li></ul><p>This free 1-hour session, led by Center Centre’s Jared, is for UX leaders ready to build a UX strategy that will transition to a proactive UX strategy. You’ll learn how you:</p><ul><li><p>Craft and implement a proactive UX strategy in your organization.</p></li><li><p>Raise the value of UX with your executives and stakeholders.</p></li><li><p>Influence critical decisions and investments in good design, when it’s early enough in the project to have a broad impact.</p></li></ul><p>Jared will show you how our Center Centre UX Strategy Leaders program has guided dozens of UX leaders to transform from reactive to proactive. He’ll show you the ins and outs of the program and how you can get the support you need to push your organization to take UX seriously.</p><p>Get everyone on the same page. Bring your team. Bring your boss. Learn what it takes to propel your organization to better UX.</p><p>Become energized. Become proactive. Drive UX strategically throughout your organization.</p><p>Come to this session to learn how to make it happen.</p><p>&nbsp;</p><p>________________________________________&nbsp;</p><p><br></p><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
