    "created": "2021-06-07T15:52:49Z",
    "description": "<h2>MVPs: Good or Bad? (Hint: Usually Bad)</h2><p><strong>Monday, June 28 at 2pm ET (18.00 GMT)</strong></p><p><span>Most MVPs are like runaway trains — ready to jump the tracks at any moment.</span></p><p><b><br></b></p><p><span>Minimum Viable Products, or MVPs as the kids like to call them, first showed up in 2001. However, it wasn’t until a decade later that it became an overnight sensation, especially with executive leaders who thought it was the answer to their biggest desire.&nbsp;</span></p><p><b><br></b></p><p><span>It was the ultimate move-fast-and-break-things approach to delivering products quickly. (And, yup, it’s definitely a great way to break things quickly.)</span></p><p><b><br></b></p><p><span>In this discussion, Jared will show the range of how teams deliver MVPs today, including a few that might work well for your organization. Learn how to get MVPs back on track so they work to your organization’s advantage. Building things quickly doesn’t require that we ship something crappy to our customers.</span></p><p><b></b><br></p><hr><p><br></p><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
