    "description": "<h2>Telling Compelling User Stories</h2><p><strong>Monday, June 21 at 2pm ET (18.00 GMT)</strong></p><p><span>Leadership happens for those who have the stories to tell about change and vision.</span></p><p><b><br></b></p><p><span>UX leaders lead through persuasion. They persuade through the stories they tell. Those stories emphasize the importance of change and the direction where things need to go.&nbsp;</span></p><p><b><br></b></p><p><span>Every UX leader needs to tell compelling stories. And every UX leader can become a better storyteller.</span></p><p><b><br></b></p><p><span>In this session, Jared will guide us through the topic we don’t learn in design school: how to tell stories that compel change. He’ll share tips and techniques from some of the world’s best storytellers. You’ll see how small changes in how you tell your stories will make big changes in your power to persuade.</span></p><p><b></b><br></p><hr><p><br></p><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
