    "description": "<h2>Mapping Out Our Users’ Current Experiences</h2><p><strong>Monday, June 14 at 2pm ET (18.00 GMT)</strong></p><p><span>Great designers don’t fall in love with their solutions. They fall in love with the problems.</span></p><p><b><br></b></p><p><span>Our user research highlights the challenges and opportunities with our users’ experiences, yet not everyone can participate in the research. There’s no better way to align on those challenges and opportunities than to show them in a map of our users’ current experiences. Great experience maps clearly illustrate to our executive stakeholders, key stakeholders, and peers where our users struggle and what makes great design valuable.</span></p><p><b><br></b></p><p><span>In this session, Jared will walk us through how UX leaders have used experience mapping to great advantage. We’ll see how those leaders increased the perceived value of UX, and directed efforts to improve the designs of their products and services.</span></p><p><b></b><br></p><hr><p><br></p><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
