    "description": "<h2>What UX Hiring Looks Like in a Post-Pandemic World</h2><p><strong>Monday, June 7 at 2pm ET (18.00 GMT)</strong></p><p><em>How we build our teams is about to change one more time.</em></p><p>All indications suggest that the UX job market is about to explode. Organizations, large and small, profit and non-profit, have all discovered they need to deliver better online and offline experiences. The way people work, shop, attend school, travel, and live out their lives is undergoing massive change, and organizations will need teams that can address that change. UX professionals will be in more demand than ever, which means we’ll need to be far more strategic when we hire for our teams.</p><p>In this session, Jared will discuss how all this change will affect how we hire our future team members. He’ll show why the teams that get the earliest start — even before they’re ready to start interviewing — are the ones who will land the best applicants, the most qualified candidates, and quickly get their new team members on board.</p><hr><p><br></p><p><strong>Join Zoom Meeting:</strong><strong>&nbsp;</strong><br><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><strong>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</strong></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!<br>Waiting Room Enabled</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
