    "created": "2021-02-22T18:40:11Z",
    "description": "<p>We tend to think of UX metrics as tools for seeing how people use our designs. However, there’s real power and magic when we take data we’ve collected and put it back into the designs we’re delivering. Sometimes, a small addition of behavior can be worth billions of dollars of additional revenue.</p><p>In this live discussion, we’ll explore how we can discover hidden value for our users, by looking into the data we collect. We’ll look closely at examples of how this is done well and talk about how you could mine your data for undiscovered value.</p><hr><p><strong>Join Zoom Meeting:&nbsp;</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</u></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!&nbsp;</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)&nbsp;</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
