    "uid": "1vc40e13tvrjv60rfra2mtea3l@google.com",
    "attendee": "",
    "created": "2021-02-22T18:39:06Z",
    "description": "<p>There’s a belief that every business can be measured by some sort of core metric. Something that surfaces where an organization stands, relative to its peers. Business leaders have been sold on metrics, such as Net Promoter Score (NPS), System Usability Score (SUS), Customer Satisfaction (C-SAT), or Customer Effort Score (CES), as a holy grail of unified metric that shows how well things are going.</p><p>However, there’s a dirty secret that the consultants behind these scores won’t tell you: They don’t actually work. They aren’t helpful and, in many organizations, only make things worse.</p><p>In this live discussion, we’ll talk about what we can do about this. Do we try to convince execs that these numbers are flawed? Do we try to replace them with something else? The answer is neither. We’ll discuss what we might do instead.</p><hr><p><strong>Join Zoom Meeting:&nbsp;</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</u></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!&nbsp;</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)&nbsp;</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
