    "created": "2021-02-22T18:37:53Z",
    "description": "<br><p>A dashboard is a common design deliverable. Its intention is to develop a display that immediately communicates a system’s health and helps users pinpoint where something may be out of whack.</p><p>While the intentions are good, the implementations are often lacking. Dashboards are often the result of incomplete research and users asking for something they don’t really want.</p><p>In this week’s live discussion, we’ll talk about why dashboards often don’t live up to their promise, and what we can do to truly help our users diagnose and treat systemic issues.</p><hr><p><strong>Join Zoom Meeting:&nbsp;</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</u></a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!&nbsp;</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)&nbsp;</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
