    "uid": "2di9kgna6tkr98fhmdqvk4f7tf@google.com",
    "attendee": "",
    "created": "2021-02-09T19:40:30Z",
    "description": "<p><span>Subject-Matter Experts (also known as SMEs) can be tremendously helpful in understanding what our users’ experiences are like. Because of their deep knowledge and experience in what it’s like to be one of our users, they’ve often been one themselves, they can contribute to our design understanding.</span></p><p><span>However, many teams treat SMEs as advocates for the users. The SMEs, with the best of intentions, often give out flawed advice and poor-informed requirements. This creates serious problems that go undetected until after the product or service ships.</span></p><p><span>In this week’s live discussion, we’ll talk about how your team can avoid these traps and get the most out of our Subject-Matter Experts.</span></p><p><b></b><br></p><p><strong>Join Zoom Meeting:&nbsp;</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09><u>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</u></a><u>&nbsp;</u></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!&nbsp;</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)&nbsp;</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
