    "created": "2020-12-30T17:39:43Z",
    "description": "<p><em>Getting to the heart of what makes a great user story.</em></p><p>In an Agile development process, teams build up—and then work through—their stockpile of user stories. Where do those user stories come from? In too many cases, they&#39;re either made up out from someone&#39;s imagination or are word-for-word customer feature requests. It&#39;s rare to see user stories we can tie directly back to user research.</p><p>In this live discussion, Jared will lead us on a journey, from UX outcomes, through experience visions and research-based scenarios, directly to well-crafted user stories. We&#39;ll see how starting from the right source helps us deliver innovative, better-designed products and services.</p><hr><p><strong>Join Zoom Meeting: </strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09 target=_blank>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome! </strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston) </p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank></a><a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
