    "created": "2020-12-30T17:39:37Z",
    "description": "<p><em>Iteration is a core concept in Agile, yet do we know the most effective techniques?</em></p><p>Iteration is an essential part of any UX design process. We try out ideas, see how they work, then go back and try again. Ideally, we get better each time. However, we never really talk about <em>how</em> to iterate.</p><p>When we&#39;re intentional about what we want to learn and how we&#39;ll measure the results we achieved, we learn a whole lot more about our design. This makes us better designers and shows everyone we work with the value of great UX design.</p><p>In this live discussion, Jared will discuss the four phases of an iteration and how teams can get the most out of every phase. You&#39;ll explore how to integrate successful iterations into your Agile sprints to ensure your team delivers the best outcomes.</p><hr><p><strong>Join Zoom Meeting: </strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09 target=_blank>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome! </strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston) </p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank></a><a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
