    "created": "2020-12-30T17:39:31Z",
    "description": "<p><em>Improve your Agile delivery by growing the UX capability of your team.</em></p><p>We can move fastest—and deliver better-designed products and services—when our teammates and stakeholders can make their own smart design decisions. So much of current UX practice is about compensating for a team that doesn&#39;t understand what a great experience could be. This gap in knowledge and understanding slows us down and makes work feel like a battle.</p><p>In this live discussion, Jared will talk through how teams introduce continuous learning as a driver to increase UX understanding and maturity. You&#39;ll explore techniques and methods for improving your Agile development process, freeing you up to work on the truly hard UX design challenges ahead of your team.</p><hr><p><strong>Join Zoom Meeting: </strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09 target=_blank>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome! </strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston) </p><p>Meeting ID: 882 9272 8501<br>Find your local number: <a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank></a><a href=https://us02web.zoom.us/u/knP9JWtT2 target=_blank>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
