    "uid": "057tr2ni8537l69sbup77qqqeb@google.com",
    "attendee": "",
    "created": "2020-12-29T21:08:31Z",
    "description": "<p><em>A smart Design Ops approach dramatically increases your team's UX effectiveness.</em></p><p>When we’re successful at growing our organization's UX design effort, a design operations team (or design ops) becomes inevitable. As<s>t</s> we grow, we'll also need a research operations team and content operations team. Operations teams are necessary to perform UX work at a large scale.</p><p>But when do we do this? Turns out, it’s not a function of the size of the team or a specific age of the UX efforts. Instead, it's when there are clear indications that the benefits of starting an operations team would pay off.</p><p></p><p>In this live discussion, Jared will describe the benefits and costs of starting an Ops team. He’ll explore what cues you should look for that tell you the timing is right to start one. You'll discuss what happens when you wait too long.</p><p><br></p><p><strong>Join Zoom Meeting:&nbsp;</strong></p><p><strong><a href=https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09>https://us02web.zoom.us/j/88292728501?pwd=Y0tBR25GbFF4MUxhWnd5MFI5S3hNUT09</a></strong></p><p><strong>Meeting ID: 882 9272 8501<br>Passcode: awesome!&nbsp;</strong></p><p>One tap mobile<br>+19294362866,,88292728501# US (New York)<br>+13017158592,,88292728501# US (Germantown)</p><p>Dial by your location<br>+1 929 436 2866 US (New York)<br>+1 301 715 8592 US (Germantown)<br>+1 312 626 6799 US (Chicago)<br>+1 669 900 6833 US (San Jose)<br>+1 253 215 8782 US (Tacoma)<br>+1 346 248 7799 US (Houston)&nbsp;</p><p>Meeting ID: 882 9272 8501<br>Find your local number:&nbsp;<a href=https://us02web.zoom.us/u/knP9JWtT2></a><a href=https://us02web.zoom.us/u/knP9JWtT2>https://us02web.zoom.us/u/knP9JWtT2</a></p>",
