    "description": "Game-Changing Experience Visions Dec &#39;20 | a Program in Leaders of Awesomeness<br><br>Our experience vision is where we want our organization to end up. Yet our peers, stakeholders, and leadership will only understand its true value when they can see what today’s experience looks like. We need to surface the actual experience our current users face, so those in our organization can see the difference our experience vision will make. In this session, Jared will give you the tools you need to up your user research game. You’ll identify where there are critical gaps in your current research efforts that you’ll need to fill. You’ll learn how to best surface the experience to the stakeholders who will give your experience vision the most support. <br><b><br></b><br><b>To join this discussion with Jared, click the link below and “Start” the Intensive program. Then, go to the Events section for event details and to RSVP.</b><br><br><a href=https://leaders.centercentre.com/courses/3359343/feed target=_blank>https://leaders.centercentre.com/courses/3359343/feed</a>",
