    "description": "Game-Changing Experience Visions | a Program in Leaders of Awesomeness<br><br>What gets measured gets done. Once our experience vision is out there, we need to know how much progress the organization has made toward making it a reality. What are the essential UX metrics to complement our experience vision efforts? In this bonus session, Jared will map the Persuasive UX Metrics framework directly to the work you did in last week’s intensive. Identify how you’ll know when you’ve succeeded at reaching your UX outcomes. You’ll learn to track the organization’s progress and identify the big obstacles that are your way. Good measures will make it easy for the organization to know exactly what’s left to do.<br><br><p><b>To join this discussion with Jared, click the link below and&nbsp;“Start” the Intensive program. Then, go to the Events section for event details and to RSVP.</b><b><br></b></p><p><a href=https://leaders.centercentre.com/courses/3106435/feed>https://leaders.centercentre.com/courses/3106435/feed</a></p>",
