    "description": "Game-Changing Experience Visions | a Program in Leaders of Awesomeness<br><br>This is the most important session of the week. If you don’t get executive support for your experience vision, it will die on the vine. You’ll know you’ve succeeded when your organization’s leadership is proudly telling your experience story to everyone they meet, explaining how this is everyone’s top priority. Jared will give you essential techniques for translating the benefits of your improved user experience into the priorities that propel stakeholders into action. You’ll learn to connect the dots between great UX and key business objectives. The executives will beg you to make your vision a reality.&nbsp;<br><strong><br></strong><br><p><b>To join this discussion with Jared, click the link below and&nbsp;“Start” the Intensive program. Then, go to the Events section for event details and to RSVP.</b><b><br></b></p><p><a href=https://leaders.centercentre.com/courses/3106435/feed>https://leaders.centercentre.com/courses/3106435/feed</a></p>",
