    "description": "Game-Changing Experience Visions | a Program in Leaders of Awesomeness<br><br>Stories are what make us human. They are what motivate us to push for change. At the core of a great experience, a vision is a compelling story about how a better user experience will improve people’s lives. Jared will show you how you’ll use envisionments to tell the story of your experience vision. He’ll share some impressive examples of how other UX leaders have told their stories. You’ll leave ready to craft your own envisionments to tell your experience vision story. (Which is good, because that’s the homework for this session.)&nbsp;<br><strong><br></strong><br><p><b>To join this discussion with Jared, click the link below and&nbsp;“Start” the Intensive program. Then, go to the Events section for event details and to RSVP.</b><b><br></b></p><p><a href=https://leaders.centercentre.com/courses/3106435/feed>https://leaders.centercentre.com/courses/3106435/feed</a></p>",
